const axios = require ( 'axios' );

export async function getAllTrademarks() {
    const response = await fetch('/api/referenceData/trademarks');
    return await response.json();
}

export async function createTrademark(data) {
    const response = await fetch(`/api/referenceData/trademark`, {
        method: 'POST',
        headers: {'Content-Type': 'application/json'},
        body: JSON.stringify({trademark: data})
    })
    return await response.json();
}

export async function deleteTrademark(trademarkId) {
    const response = await fetch(`/api/referenceData/trademark/${trademarkId}`, {method: 'DELETE'})
    return await response.json();
}

export async function editTrademark(data) {
    const response = await fetch(`/api/referenceData/trademark`, {
        method: 'PUT',
        headers: {'Content-Type': 'application/json'},
        body: JSON.stringify({trademark: data})
    })
    return await response.json();
}
